import React from 'react';

export default function Scoreboard({ score, highScore }) {
  return (
    <div className="flex justify-between items-center p-4 rounded-lg bg-white/10 backdrop-blur-md shadow-lg text-white w-full max-w-lg mt-10">
      <div className="flex items-center space-x-2">
        <span className="text-2xl font-semibold">Score:</span>
        <span className="text-2xl font-bold text-yellow-400">{score}</span>
      </div>
      <div className="flex items-center space-x-2">
        <span className="text-2xl font-semibold">High Score:</span>
        <span className="text-2xl font-bold text-yellow-400">{highScore}</span>
      </div>
    </div>
  );
}
